import React, {Component} from 'react'
import {Route, Switch, Redirect} from 'react-router-dom'

import PageLayout from './layout/PageLayout'

class App extends Component{

    render(){
        return(
            <div>
                <Switch>
                    <Route exact path='' component={PageLayout}/>
                    <Redirect to=''/>
                </Switch>
            </div>
        )
    }
}

export default App
